import React, { Component } from 'react'

export class NewsItems extends Component {
    
  render() {
    let {title, description,imageUrl,newsUrl} = this.props;
    return (
        <>
        <div className="card" style={{ width: "18rem"}}>
        <img src={!imageUrl?"https://images.livemint.com/img/2023/02/01/600x338/galaxy_unpacked_1675228010103_1675228018823_1675228018823.jpg":imageUrl} className="card-img-top" alt="..."/>
        <div className="card-body">
          <h5 className="card-title">{title}...</h5>
          <p className="card-text">{description}...</p>
          <a href={newsUrl} target="_blank" rel="noreferrer" className="btn btn-sm btn-primary">Go somewhere</a>
        </div>
        </div>
      </>
    )
  }
}

export default NewsItems
